To simplify the PyO3 conversion traits, the FromPy trait has been removed. Previously there were two ways to define the to-Python conversion for a type: FromPy<T> for PyObject and IntoPy<PyObject> for T. Now there is only one way to define the conversion, IntoPy, so downstream crates may need to adjust accordingly. Before: # use pyo3::prelude::*;
struct MyPyObjectWrapper(PyObject); impl FromPy<MyPyObjectWrapper> for PyObject { fn from_py(other: MyPyObjectWrapper, _py: Python) -> Self { other.0 }
} After # use pyo3::prelude::*;
struct MyPyObjectWrapper(PyObject); impl IntoPy<PyObject> for MyPyObjectWrapper { fn into_py(self, _py: Python) -> PyObject { self.0 }
} Similarly, code which was using the FromPy trait can be trivially rewritten to use IntoPy. Before: # use pyo3::prelude::*;
# Python::with_gil(|py| {
let obj = PyObject::from_py(1.234, py);
# }) After: # use pyo3::prelude::*;
# Python::with_gil(|py| {
let obj: PyObject = 1.234.into_py(py);
# })

