You sometimes need to convert your pyclass into a Python object and access it from Rust code (e.g., for testing it). PyCell is the primary interface for that. PyCell<T: PyClass> is always allocated in the Python heap, so Rust doesn't have ownership of it. In other words, Rust code can only extract a &PyCell<T>, not a PyCell<T>. Thus, to mutate data behind &PyCell safely, PyO3 employs the Interior Mutability Pattern like RefCell . Users who are familiar with RefCell can use PyCell just like RefCell. For users who are not very familiar with RefCell, here is a reminder of Rust's rules of borrowing: At any given time, you can have either (but not both of) one mutable reference or any number of immutable references. References must always be valid. PyCell, like RefCell, ensures these borrowing rules by tracking references at runtime. # use pyo3::prelude::*;
# use pyo3::types::PyDict;
#[pyclass]
struct MyClass { #[pyo3(get)] num: i32, debug: bool,
}
let gil = Python::acquire_gil();
let py = gil.python();
let obj = PyCell::new(py, MyClass { num: 3, debug: true }).unwrap();
{ let obj_ref = obj.borrow(); // Get PyRef assert_eq!(obj_ref.num, 3); // You cannot get PyRefMut unless all PyRefs are dropped assert!(obj.try_borrow_mut().is_err());
}
{ let mut obj_mut = obj.borrow_mut(); // Get PyRefMut obj_mut.num = 5; // You cannot get any other refs until the PyRefMut is dropped assert!(obj.try_borrow().is_err()); assert!(obj.try_borrow_mut().is_err());
} // You can convert `&PyCell` to a Python object
pyo3::py_run!(py, obj, "assert obj.num == 5") &PyCell<T> is bounded by the same lifetime as a GILGuard . To make the object longer lived (for example, to store it in a struct on the Rust side), you can use Py<T>, which stores an object longer than the GIL lifetime, and therefore needs a Python<'_> token to access. # use pyo3::prelude::*;
#[pyclass]
struct MyClass { num: i32,
}
fn return_myclass() -> Py<MyClass> { let gil = Python::acquire_gil(); let py = gil.python(); Py::new(py, MyClass { num: 1 }).unwrap()
}
let gil = Python::acquire_gil();
let obj = return_myclass();
let cell = obj.as_ref(gil.python()); // Py<MyClass>::as_ref returns &PyCell<MyClass>
let obj_ref = cell.borrow(); // Get PyRef<T>
assert_eq!(obj_ref.num, 1);

