You can create a module as follows: use pyo3::prelude::*; // add bindings to the generated Python module
// N.B: "rust2py" must be the name of the `.so` or `.pyd` file. /// This module is implemented in Rust.
#[pymodule]
fn rust2py(py: Python, m: &PyModule) -> PyResult<()> { // PyO3 aware function. All of our Python interfaces could be declared in a separate module. // Note that the `#[pyfn()]` annotation automatically converts the arguments from // Python objects to Rust values, and the Rust return value back into a Python object. // The `_py` argument represents that we're holding the GIL. #[pyfn(m, "sum_as_string")] fn sum_as_string_py(_py: Python, a: i64, b: i64) -> PyResult<String> { let out = sum_as_string(a, b); Ok(out) } Ok(())
} // logic implemented as a normal Rust function
fn sum_as_string(a: i64, b: i64) -> String { format!("{}", a + b)
} # fn main() {} The #[pymodule] procedural macro attribute takes care of exporting the initialization function of your module to Python. It can take as an argument the name of your module, which must be the name of the .so or .pyd file; the default is the Rust function's name. If the name of the module (the default being the function name) does not match the name of the .so or .pyd file, you will get an import error in Python with the following message: ImportError: dynamic module does not define module export function (PyInit_name_of_your_module) To import the module, either copy the shared library as described in the README or use a tool, e.g. maturin develop with maturin or python setup.py develop with setuptools-rust .
